--Dropping the tables if existed
drop table health_history;
drop table organ;
drop table donor;
drop table recipient;
drop table user_info;

--Create statement for user_info table
create table user_info(
user_id numeric primary key not null,
user_name varchar(30) not null,
user_email varchar(50),
phone_number numeric(10) not null,
address varchar(500) not null,
user_type char(1) not null
);

--Create statement for donor table
create table donor(
user_id numeric primary key not null,
dob date not null,
gender varchar (6) not null,
height numeric (5, 2),
weight numeric (5, 2),
blood_type varchar (3) not null,
foreign key (user_id) references user_info
);

--Create statement for recipient table
create table recipient(
user_id numeric primary key not null,
dob date not null,
gender varchar (6) not null,
height numeric (5, 2),
weight numeric (5, 2),
blood_type varchar (3) not null,
organ_needed varchar (20) not null,
foreign key (user_id) references user_info
);

--Create statement for organ table
create table organ(
organ_id numeric primary key not null,
user_id numeric not null,
organ_type varchar (20) not null,
availibility varchar (10) not null,
foreign key (user_id) references donor
);

--Create statement for health_history table 
create table health_history(
user_id numeric primary key not null,
smoker varchar (3) not null,
drinker varchar (3) not null,
drug_abuse varchar (3) not null,
surgical_history varchar (3) not null,
foreign key (user_id) references user_info
);

